import React, { Component } from "react";


class Intro extends Component {
    state = {  }
    render() { 
        return (
            <div>
                <h1>
                    Introduction
                </h1>
            <p>
              After gathering the entire requirements specific to software
              project usually we need to think about different solution strategy
              for the project. Expert business analysts are analyzing their
              benefits and as well as their shortcomings by means of cost, time
              and resources require to develop it. In this experiment, we will
              learn how to estimate cost, effort and duration for a software
              project, and then select one solution approach which will be found
              suitable to fulfill the organizational goal.
            </p>
          </div>
        );
    }
}

export default Intro;
